import React from "react";
import Card from "./Card";
const data = [
  {
    iconUrl: "../images/icon-facebook.svg",
    userName: "@nathanf",
    stat: "1987",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 12,
  },
  {
    iconUrl: "../images/icon-twitter.svg",
    userName: "@nathanf",
    stat: "1044",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 99,
  },
  {
    iconUrl: "../images/icon-instagram.svg",
    userName: "@realnathanf",
    stat: "11k",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 1099,
  },
  {
    iconUrl: "../images/icon-youtube.svg",
    userName: "Nathan F.",
    stat: "8239",
    statType: "SUBSCRIBERS",
    voteIconType: "down",
    noOfVotes: 144,
  },
];

function DashBoardRow(props) {
  let i = 0;
  return (
    <div className="dashboard-row">
      <Card
        iconUrl={data[0].iconUrl}
        userName={data[0].userName}
        stat={data[0].stat}
        statType={data[0].statType}
        voteIconType={data[0].voteIconType}
        noOfVotes={data[0].noOfVotes}
        className="col col-1"
        key="0"
      ></Card>
      <Card
        iconUrl={data[1].iconUrl}
        userName={data[1].userName}
        stat={data[1].stat}
        statType={data[1].statType}
        voteIconType={data[1].voteIconType}
        noOfVotes={data[0].noOfVotes}
        className="col col-2"
        key="1"
      ></Card>
      <Card
        iconUrl={data[2].iconUrl}
        userName={data[2].userName}
        stat={data[2].stat}
        statType={data[2].statType}
        voteIconType={data[2].voteIconType}
        noOfVotes={data[2].noOfVotes}
        className="col col-3"
        key="2"
      ></Card>
      <Card
        iconUrl={data[3].iconUrl}
        userName={data[3].userName}
        stat={data[3].stat}
        statType={data[3].statType}
        voteIconType={data[3].voteIconType}
        noOfVotes={data[3].noOfVotes}
        className="col col-4"
        key="3"
      ></Card>
    </div>
  );
}
export default DashBoardRow;
